  [],\n\t\"revision_timestamp\": \"2016-07-27T23:01:49.537506\",\n\t\"name\": \"winter-feeding-ecology-and-trophic-relationships-of-marine-birds-in-kachemak-bay-alaska-fi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The winter feeding ecology of oldsquaw,
  white-winged scoters, common murres and marbled murrelet was studied on Kachemak
  Bay, Alaska, from November 1977 through April 1978. The birds together ate a minimum
  of 79prey species. The sea ducks ate mostly benthic bivalves and gastropods, with
  fish and crustaceans sometimes important, while the alcids ate mostly pelagic and
  demersal crustaceans and fish. Birds wintering in Kachemak Bay appear to be at high
  risk from both acute and chronic oil spills.\",\n\t\"license_title\": \"License
